INSERT INTO `barang` VALUES (32,'ECS Motherboard Socket LGA1155 H61H2-MV','ecs-motherboard-socket-lga1155-h61h2mv','<div>Dengan TES ketahanan DURATHON dari ECS , dimana motherboard ECS dites ketahanan dan kestabilan-nya pada keadaan EXTREME terus menerus, melebihi batas tes motherboard pabrikan lainnya, sehingga jelas sudah tidak diragukan lagi ketahanannya untuk jangka panjang penggunaan, baik itu home office , gaming pc, warnet yang standby 24/7.<br></div><ul><li>Applied Solid Capacitor for CPU VRM to ensure a longer lifespan for system<br></li><li>ECS MIB III - A friendly interface for overclocking</li><li>Microsoft Windows 8 Certified</li><li>Intel® 22nm 3rd generation Multi-Core CPU support</li><li>ECS Intelligent EZ Utility : eBLU, eDLU, eSF</li><li>Free Bundle: Norton Internet Security ,CyberLink PowerDVD, CyberLink PowerDirector 9,</li><li>Muzee with trial version</li></ul><p></p>',79,618000,30000,4,2,22,18,6,'y','y','y'),(33,'VGA XFX AMD Radeon HD 6970 HD-697A-CNDC','vga-xfx-amd-radeon-hd-6970-hd697acndc','<p><b>Graphic Interface</b>&nbsp;&nbsp;&nbsp; PCI-e 2.1 16x <br><b>Graphic Chipset&nbsp;</b>&nbsp;&nbsp; ATI Radeon HD 6970 <br><b>Engine Clock Speed</b>&nbsp;&nbsp;&nbsp; 900 MHz <br><b>Memory Provided</b>&nbsp;&nbsp;&nbsp; 2GB DDR5 <br><b>Memory Bus</b>&nbsp;&nbsp;&nbsp; 256-bit <br><b>Memory Clock Speed</b>&nbsp;&nbsp;&nbsp; 5.5GHz (1375X 4) <br><b>Max. Video Resolution</b>&nbsp;&nbsp;&nbsp; 2560 x 1600 <br><b>Display Output</b>&nbsp;&nbsp;&nbsp; Dual DVI, HDMI, Dual mini Display Port <br></p>',80,3050000,50000,3,1.6,20,11,5,'y','y','y'),(34,'VGA card XFX AMD Radeon HD 7770 FX 777A ZNBC','vga-card-xfx-amd-radeon-hd-7770-fx-777a-znbc','<p><b>Graphic Interface</b>&nbsp;&nbsp; &nbsp;PCI-e 16x 3.0 <br><b>Graphic Chipset</b>&nbsp;&nbsp; &nbsp;ATI Radeon HD 7770 <br><b>Chipset Features&nbsp;</b>&nbsp; &nbsp;1095 MHz <br><b>Memory Provided</b>&nbsp;&nbsp; &nbsp;1GB DDR5 <br><b>Memory Bus&nbsp;</b>&nbsp; &nbsp;128-bit <br><b>Memory Clock Speed</b>&nbsp;&nbsp; &nbsp;4.98 GHz <br><b>Max. Video Resolution&nbsp;&nbsp;&nbsp;</b> <br>&nbsp;&nbsp;&nbsp; Max Supported Resolution (ANALOG):2048 x 1536&nbsp; <br>&nbsp;&nbsp;&nbsp; Max Supported Resolution (DIGITAL):2560 x 1600&nbsp; <br><b>Display Output&nbsp;</b>&nbsp; &nbsp;DL-DVI, HDMI, mini DP <br><br></p>',80,1800000,50000,5,1.6,20,11,6,'y','y','y'),(35,'VGA GIGABYTE NVidia GeForce GTX 650 GV N650OC 2GI das as dsa das das das das da','vga-gigabyte-nvidia-geforce-gtx-650-gv-n650oc-2gi-das-as-dsa-das-das-das-das-da','<p><b>GIGABYTE Ultra Durable VGA Series</b><br></p><ul><li>Didukung oleh NVIDIA GeForce GTX 650 GPU&nbsp;</li><li>Terintegrasi dengan memori DDR5 2GB terbaik industri 128-bit memory interface&nbsp;&nbsp;&nbsp;</li><li>Fitur Dual link D-Sub / DVI-D/ HDMI&nbsp;&nbsp;</li><li>Core Clock: 1110 Mhz&nbsp;&nbsp;</li><li>Didukung PCI Express 3.0 x16 bus interface&nbsp;&nbsp;&nbsp;</li><li>Didukung Teknologi NVIDIA 3D Vision™&nbsp;&nbsp;</li><li>Didukung Teknologi NVIDIA® CUDA™&nbsp;&nbsp;</li><li>Didukung Teknologi NVIDIA® PhysX™&nbsp;&nbsp;&nbsp;</li><li>Didukung Teknologi NVIDIA® FXAA / TXAA&nbsp;&nbsp;</li><li>Didukung Teknologi NVIDIA® Adaptive Vertical Sync&nbsp;&nbsp;</li><li>Sistem listrik persyaratan: 400W&nbsp; <br></li></ul><p><b>Graphic Interface</b>&nbsp;&nbsp;&nbsp; PCI-e 3.0 <br><b>Graphic Chipset</b>&nbsp;&nbsp;&nbsp; GeForce GTX 650 <br><b>Engine Clock Speed</b>&nbsp;&nbsp;&nbsp; 1110 MHz (standard : 1058 MHz) <br><b>Memory Provided</b>&nbsp;&nbsp;&nbsp; 2GB DDR5 <br><b>Memory Bus</b>&nbsp;&nbsp;&nbsp; 128-Bit <br><b>Memory Clock Speed</b>&nbsp;&nbsp;&nbsp; 5000 MHz <br><b>Max. Video Resolution</b>&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp; Digital : 2560 x 1600&nbsp; <br>&nbsp;&nbsp;&nbsp; Analog : 2048 x 1536&nbsp; <br><b>Display Output</b>&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp; D-Sub&nbsp; <br>&nbsp;&nbsp;&nbsp; Dual-link DVI-D&nbsp; <br>&nbsp;&nbsp;&nbsp; HDMI 1&nbsp; <br></p>',81,2100000,40000,6,1.6,20,11,6,'y','y','y'),(36,'NVidia GeForce GTX 760 Palit DIGITAL ALLIANCE ','nvidia-geforce-gtx-760-palit-digital-alliance-','<p><b>NVIDIA CUDA™ Parallel Computing Architecture1</b><br>&nbsp;&nbsp;&nbsp; Teknologi CUDA membuka kekuatan prosesor core GPU untuk mempercepat tugas-tugas sistem yang paling menuntut - seperti video transcoding - memberikan peningkatan kinerja yang luar biasa dibandingkan CPU tradisional.&nbsp; <br><b><br>DirectCompute Support</b><br>&nbsp;&nbsp;&nbsp; Dukungan penuh untuk Direct Compute, Microsoft GPU komputer API.&nbsp; <br><b><br>Microsoft® Windows® 7 Support</b><br>&nbsp;&nbsp;&nbsp; Windows 7 adalah sistem operasi generasi berikutnya yang akan menandai peningkatan dramatis dalam cara OS mengambil keuntungan dari graphics processing unit (GPU) untuk memberikan pengalaman pengguna yang lebih menarik. Dengan mengambil keuntungan dari GPU untuk kedua grafis dan komputer, Windows 7 tidak hanya akan membuat PC saat ini lebih visual dan lebih interaktif, tetapi juga memastikan bahwa mereka memiliki kecepatan dan daya tanggap yang pelanggan inginkan.&nbsp; <br><br><b>NVIDIA® GeForce® Unified Driver Architecture (UDA)</b><br>&nbsp;&nbsp;&nbsp; Memberikan catatan yang telah terbukti kompatibilitas, reliabilitas, dan stabilitas dengan jangkauan terluas permainan dan aplikasi. Driver GeForce memberikan yang terbaik pengalaman out-of-box untuk setiap pengguna dan memberikan kinerja dan fitur update terus-menerus selama masa GeForce GPU. <br>&nbsp;<br><b>Mesin NVIDIA ® ™ Lumenex</b><br>&nbsp;&nbsp;&nbsp; Memberikan kualitas gambar yang menakjubkan dan akurasi floating point pada frame rate yang ultra-cepat.&nbsp; <br><b><br>6x Anti-aliasing Technology</b><br>&nbsp;&nbsp;&nbsp; Cepat kilat, berkualitas tinggi anti-aliasing sampai dengan 16x tingkat sampel yang melenyapkan tepi bergerigi.&nbsp; <br><br><b>128-bit floating point High Dynamic-Range (HDR) Lighting</b><br>&nbsp;&nbsp;&nbsp; Dua kali ketepatan generasi sebelumnya untuk efek-sekarang pencahayaan sangat realistis dengan dukungan untuk anti-aliasing.&nbsp; <br><br><b>NVIDIA® PureVideo® HD Technology2</b><br>&nbsp;&nbsp;&nbsp; Kombinasi high-definition video decode percepatan dan post-processing yang memberikan kejelasan belum pernah terjadi sebelumnya gambar, video yang halus, warna yang akurat, dan skala gambar yang tepat untuk film dan video.&nbsp; <br><b><br>PCI Express 2.0 Support</b><br>&nbsp;&nbsp;&nbsp; Dirancang untuk arsitektur bus PCI Express 2.0 baru yang menawarkan tertinggi kecepatan transfer data untuk permainan yang paling membutuhkan bandwidth dan aplikasi 3D, dengan tetap menjaga kompatibilitas mundur dengan motherboard PCI Express yang ada untuk dukungan luas.&nbsp; <br><br><b>Full Microsoft® DirectX® 10.1 Support</b><br>&nbsp;&nbsp;&nbsp; DirectX 10.1 GPU dengan dukungan penuh Shader Model 4.1 memberikan tingkat grafis tak tertandingi realisme dan efek film berkualitas.&nbsp; <br><b><br>Hardware Decode Acceleration</b><br>&nbsp;&nbsp;&nbsp; Menyediakan pemutaran ultra-halus H.264, VC-1, WMV, DivX, MPEG-2 dan MPEG-4 HD dan film SD tanpa perlu untuk CPU dual atau quad-core.&nbsp; <br><b><br>Dual-link DVI Support</b><br>&nbsp;&nbsp;&nbsp; Mampu mendorong industri terbesar dan tertinggi resolusi datar panel menampilkan hingga 2560x1600 dan dengan dukungan untuk High-bandwidth Digital Content Protection (HDCP).&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp; <br><b>Graphic Interface</b>&nbsp;&nbsp;&nbsp; PCI Express 3.0 <br><b>Graphic Chipset&nbsp;</b>&nbsp;&nbsp; GeForce GTX 760 <br><b>Engine Clock Speed</b>&nbsp;&nbsp;&nbsp; 980MHz/Boost Clock 1033MHz <br><b>Memory Clock Speed</b>&nbsp;&nbsp;&nbsp; 3004MHz (DDR 6008MHz) <br><b>Memory Bandwidth</b>&nbsp;&nbsp;&nbsp; 256bit <br><b>Max. Video Resolution</b>&nbsp;&nbsp;&nbsp; 4096x2160 <br><b>Display Output</b>&nbsp;&nbsp;&nbsp; DL-DVI-I/SL-DVI-D/HDMI/Display Port <br></p>',82,3650000,100000,5,2,25,15,10,'y','y','y'),(37,' AMD Radeon HD 7870 IceQ X H787QN2G2M HIS','-amd-radeon-hd-7870-iceq-x-h787qn2g2m-his','<p><b>Graphic Interface&nbsp;</b>&nbsp;&nbsp; PCI Express 3.0 x16 <br><b>Graphic Chipset&nbsp;</b>&nbsp;&nbsp; Radeon HD 7870 PCIe Series <br><b>Engine Clock Speed&nbsp;</b>&nbsp;&nbsp; 1000 MHz <br><b>Memory Provided</b>&nbsp;&nbsp;&nbsp; 2GB DDR5 <br><b>Memory Bus</b>&nbsp;&nbsp;&nbsp; 256 bit <br><b>Memory Clock Speed&nbsp;</b>&nbsp;&nbsp; 4.8Gbps <br><b>Max. Video Resolution&nbsp;&nbsp;</b>&nbsp; <br>&nbsp;&nbsp;&nbsp; DisplayPort 1.2: 4096 x 2160&nbsp; <br>&nbsp;&nbsp;&nbsp; Dual-link DVI: 2560 x 1600&nbsp; <br>&nbsp;&nbsp;&nbsp; VGA: 2048 x 1536&nbsp; <br><b>Display Output</b>&nbsp;&nbsp;&nbsp; Dual-link DVI-I, Mini Display Port, HDMI <br></p>',74,3350000,100000,1,2,22,12,8,'y','y','y'),(38,'Portable Hard Drive 1TB V6 TOSHIBA Canvio Basic 3.0  - White','portable-hard-drive-1tb-v6-toshiba-canvio-basic-30--white','<p>Penyimpanan dibuat sederhana dengan Toshiba Canvio Basic 3.0 Portable Hard Drive. Hadir dengan plug dan play operation, dan semua yang harus Anda lakukan adalah drag dan drop semua file Anda untuk disimpan.</p><p></p><ul><li>USB 3.0 powered untuk kemudahan plug and play operation &nbsp;</li><li>Mudah digunakan tanpa perlu instal software &nbsp;</li><li>Internal Shock Sensor dan Teknologi ramp loading membantu melindungi drive dan data Anda. &nbsp;</li></ul><p></p><div><b>Tipe</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>External Hard Drive 2.5\"&nbsp;</div><div><div><b>Antarmuka / Interface</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>USB 3.0&nbsp;</div><div><b>Kecepatan Putaran / RPM</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>5400 RPM&nbsp;</div><div><b>Kesesuaian Sistem Operasi</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Windows® 7, Vista dan XP&nbsp;</div></div>',83,1025000,32000,5,1,13,9,5,'y','y','y'),(39,'Desk Hard Drive 2TB TOSHIBA Canvio 3.0 - Black','desk-hard-drive-2tb-toshiba-canvio-30-black','<p>Backup seluruh komputer termasuk sistem operasi, program dan pengaturan pada kecepatan super cepat dengan perangkat Toshiba Canvio® Desk Hard.</p><p></p><ul><li>Desain fan-less yang menjaga operation whisper quiet sambil menjaga drive tetap dingin &nbsp;</li><li>Versatile orientation untuk menyesuaikan ruang Anda di rumah dan kantor Anda &nbsp;</li><li>Backup dan restore seluruh sistem komputer termasuk sistem operasi, program, dan pengaturan-pengaturan &nbsp;</li><li>Atau menyesuaikan backup ke folder yang sudah dipilih dan file-file &nbsp;</li><li>Amankan backup Anda dengan password (hingga 256bit enkripsi data) &nbsp;</li><li>Drive Space Alert memperingatkan Anda ketika kehabisan kapasitas cadangan &nbsp;</li><li>Backup penjadwalan secara otomatis (jam, hari, minggu, dll) &nbsp;</li><li>Transfer file besar dengan kecepatan super cepat SuperSpeed USB3.0 (kompatibel dengan USB 2.0). &nbsp;</li></ul><p></p><div><b>Tipe</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>External Hard Drive 3.5\"&nbsp;</div><div><div><b>Antarmuka / Interface</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>USB 3.0&nbsp;</div><div><b>Kecepatan Putaran / RPM</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>5,700 RPM&nbsp;</div><div><b>Kesesuaian Sistem Operasi</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Windows® XP/Vista/7, Mac OS® X Tiger®, Leopard® atau Snow Leopard®&nbsp;</div></div>',83,1500000,50000,7,2,17,13,4,'y','y','y'),(40,'External Desktop USB 3.0 3TB SEAGATE STBV3000300','external-desktop-usb-30-3tb-seagate-stbv3000300','<p>Hard disk Eksternal Seagate® Expansion™ dari Seagate menawarkan solusi mudah ketika Anda perlu menambah penyimpanan data seketika pada komputer Anda. Cukup seret dan jatuhkan untuk menyimpan file, transfer data yang cepat dengan konektivitas USB 3.0</p><p><b>Solusi penyimpanan yang mudah digunakan.</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; Hard disk eksternal Expansion ini mudah diinstal dengan mencolokkan ke dua kabel. Anda dapat mulai menyimpan file digital ke hard disk ini dalam hitungan detik setelah dilepaskan dari kotaknya. &nbsp;</p><p><b>Menambah kapasitas penyimpanan seketika</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; File foto digital, video, dan file musik dapat membebani penyimpanan komputer Anda, menyebabkan kinerja menurun karena hard disk internalnya memenuhi kapasitas. Hard disk eksternal Expansion menghadirkan beragam kapasitas, dengan model 3 TB menawarkan penyimpanan data yang cukup untuk 3.000 jam video digital, 750 film DVD 2 jam, 960.000 foto digital, dan 49.980 jam musik digital &nbsp;</p><p><b>Menginstal dalam hitungan detik.</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; Fitur hard disk eksternal Seagate® Expansion® seperti ini memudahkan penggunaan hard disk ini dalam hitungan detik setelah dilepas dari kotaknya &nbsp;</p><p><b></b></p><blockquote><p><b>Tipe</b> External Hard Drive 3.5\"&nbsp;</p><p><b>Antarmuka / Interface</b><span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span>USB 3.0&nbsp;</p><p><b>Kecepatan Putaran / RPM</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>5900 RPM&nbsp;</p><p><b>Kesesuaian Sistem Operasi</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Automatically recognized by Windows®.&nbsp;</p><p><b>Dimensi</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>37x179x118 mm (HxDxW)&nbsp;</p><p><b>Berat</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>0.94 kg&nbsp;</p><p><b>Kelengkapan Paket<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span></b></p><p>&nbsp; &nbsp; Hard disk eksternal Expansion &nbsp;</p><p>&nbsp; &nbsp; Kabel USB 3.0 atau kabel USB 2.0 &nbsp;</p><p>&nbsp; &nbsp; Adaptor daya &nbsp;</p><p>&nbsp; &nbsp; Panduan mulai cepat &nbsp;</p></blockquote><p></p>',84,1700000,40000,3,2,18,12,4,'y','y','y'),(41,'AMD Quad Core Llano A8-3870K','amd-quad-core-llano-a83870k','<p><b>Processor</b> <span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>AMD Quad-Core Black Edition A8-Series APU 