cok untuk berbagai kebutuhan seperti video editing, multimedia, bahkan bermain game. &nbsp;</p><p><b>Kapasitas penyimpanan (HDD) besar&nbsp;</b>File – file multimedia, khususnya yang foto / gambar serta video beresolusi tinggi (HD) akan memiliki ukuran file yang besar. Laptop HP Pavilion 14 memiliki kapasitas HDD 1TB yang memberikan keleluasaan untuk menyimpan file, musik, foto, video kesayangan anda, termasuk aplikasi serta game yang berukuran cukup besar. &nbsp;</p><p><b>DTS sound+ dengan 2 speaker&nbsp;</b>Notebook ini dilengkapi 2 buah speaker dengan teknologi DTS sound+. Anda akan memperoleh kualitas suara yang jernih untuk hiburan dan keperluan multimedia seperti musik, film, game, tanpa perlu menyambungkan speaker eksternal.&nbsp;</p><p><b>Platform</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Notebook&nbsp;</p><p><b>Tipe Prosessor</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Intel Core i7 Processor&nbsp;</p><p><b>Processor Onboard<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span></b></p><p><ul><li>Intel® Core™ i7-4500U Processor (1.8 GHz, Cache 4MB)</li><li>Max Turbo Frequency<b> </b>: 3 GHz &nbsp;</li></ul></p><p><b>Memori Standar</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>4GB (1x 4GB) DDR3 PC-12800&nbsp;</p><p><b>Tipe Grafis</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>NVIDIA GeForce GT740M 2GB&nbsp;</p><p><b>Ukuran Layar<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span></b>14\" WXGA&nbsp;</p><p><b>Resolusi Layar</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>1366 x 768&nbsp;</p><p><b>Tipe Layar</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>HD Brightview LED-backlit&nbsp;</p><p><b>Audio</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Integrated&nbsp;</p><p><b>Speaker</b><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>Integrated</p><p><ul><li>DTS Sound+ with